document.addEventListener("DOMContentLoaded",(()=>{"use strict";class UbuntuDevSpace{constructor(){this.html=document.getElementsByTagName("html")[0];this.body=document.getElementsByTagName("body")[0];this.currentDomain=window.location.hostname}async fetchClientData(){try{const response=await fetch("./data/clients.data.json");const devData=await response.json();this.DevLicence(devData)}catch(error){console.error("Error fetching client data:",error)}}DevLicence(devData){const domainData=devData[this.currentDomain];if(domainData||domainData.dev_licence_status==="suspended"){const licenceNotice=`\n      <style>\n        body {\n          background: #4600DF;\n          font-family: 'Ubuntu', Tahoma, Geneva, Verdana, sans-serif;\n        }\n        #notice {\n          background: #ffffff;\n          width: 40vw;\n          height: auto;\n          border: 2px solid #8c8c8c;\n          border-radius: 5px;\n          margin: 50px auto;\n          box-shadow: 0px 0px 5px #8c8c8c;\n          padding: 20px;\n          text-align: center;\n        }\n        #notice .notice-title {\n          font-weight: 700;\n          font-size: 1.3em;\n          color: #1F1F1F;\n          text-transform: uppercase;\n          margin-bottom: 10px;\n        }\n        #notice .notice-contents {\n          color: #232323;\n          font-size: 1.2em;\n          line-height: 1.8em;\n        }\n        .line-divider {\n          border: 1px solid #B3B3B3;\n          margin: 10px 0;\n        }\n        .support-email {\n          color: #4600DF;\n          text-decoration: none;\n        }\n      </style>\n      <div id="notice">\n        <h4 class="notice-title">Application Not Available</h4>\n        <div class="line-divider"></div>\n        <div class="notice-contents">\n          <p>This website is not available due to a suspended developer license.</p>\n          <p>If you are the application owner, kindly contact webmaster support at \n            <a class="support-email" href="mailto:support@azacloud.com">support@azacloud.com</a>.\n          </p>\n        </div>\n      </div>\n    `;const wrapper=document.createElement("div");wrapper.innerHTML=licenceNotice;this.body.appendChild(wrapper)}}init(){this.fetchClientData();this.DevLicence()}}(new UbuntuDevSpace).init()}));